import React from 'react'
import Form from './Form'
import Quiz from './Quiz';

 function Raoutpage() {
  if (props.page == 1) {
    return   <Form/>
  }
  else if (props.page == 2){
    return <Quiz/>
  }
}
export default Raoutpage;
